package JavaPgms;

public class ifelseotherpgm {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10, b=20, c=30;
		if(a>b){
			System.out.println("a is greater");
		}
		else if(b>c){
			System.out.println("b is greater");
		}
		else if(c>b){
			System.out.println("b is greater");
		}
	}
	
}
